        <div>{icon}{icon2}
        <h5 className="heading">Welcome to<br/> Systempackage</h5>
            <div className="auth-form-container">
                <form className="login-form" onSubmit={handleSubmit}>
                    <input className="EMAIL"  value={email} onChange={(e) => setEmail(e.target.value)}type="email" placeholder="hellouser" id="email" name="email" />
                    <input className="PASSWORD" value={pass} onChange={(e) => setPass(e.target.value)} type="password" placeholder="•••••••••• " id="password" name="password" />
                    <button className="SUBMIT" type="submit">Next</button>
                    <button className="forgot"  onClick={() => props.onFormSwitch('register')}>Forgot your password?</button>
                    <div> Not member? <button className="link-btn"  onClick={() => props.onFormSwitch('register')}>Create account.</button> </div>
                </form>
            </div>
        </div>
        
    )
}
